import React, { Component } from 'react';
import Login from './Login'
import Upgrade from './Upgrade'

export default class Shop extends Component {
  render() {
  	const {upgrades} = this.props
    return (
    	<div>
    		<div id="ppc">
    			<p>PPC</p>
		      <Upgrade type="ppc" src={require("../img/chip.png")} prix="10" name="Intel Celeron" upgradeLvl={upgrades[0]} id="0" myCoin={this.props.myCoin} gameFunction={this.props.gameFunction}/>
		      <Upgrade type="ppc" src={require("../img/chip2.png")}prix="100" name="Intel I5" upgradeLvl={upgrades[1]} id="1" myCoin={this.props.myCoin} gameFunction={this.props.gameFunction}/>
	     	</div>
	     	<div id="pps">
	     		<p>PPS</p>
		      <Upgrade type="ppc" src="https://imageog.flaticon.com/icons/png/512/141/141006.png?size=1200x630f&pad=10,10,10,10&ext=png&bg=FFFFFFFF"prix="10" name="Intel Celeron" upgradeLvl={upgrades[0]} id="0" myCoin={this.props.myCoin} gameFunction={this.props.gameFunction}/>
		      <Upgrade type="ppc" src="https://imageog.flaticon.com/icons/png/512/141/141007.png?size=1200x630f&pad=10,10,10,10&ext=png&bg=FFFFFFFF"prix="100" name="Intel I5" upgradeLvl={upgrades[1]} id="1" myCoin={this.props.myCoin} gameFunction={this.props.gameFunction}/>
	     	</div>
      </div>
    );
  }
}
